import { styled } from "styled-components";

export const Container = styled.div`
  position: relative;
  display: felx;
`;

export const Bar = styled.div`
  position: realtive;
`;

export const Time = styled.div`
  position: absolute;
  color: #000;
  text-align: center;
  font-family: "Pretendard Variable";
  font-size: 18px;
  font-style: normal;
  font-weight: 500;
  line-height: 25px; /* 138.889% */
`;

export const Connecting = styled.div`
  width: 16px;
  height: 12.173px;
  flex-shrink: 0;
`;

export const Wifi = styled.div`
  width: 16px;
  height: 12.173px;
  flex-shrink: 0;
`;

export const Battery = styled.div`
  width: 25px;
  height: 12.173px;
  flex-shrink: 0;
`;

export const Backbtn = styled.div`
  width: 30px;
  height: 30px;
  flex-shrink: 0;
`;

export const Title = styled.div`
  color: #000;
  text-align: center;
  font-family: "Pretendard Variable";
  font-size: 20px;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
  letter-spacing: -0.5px;
`;
